import React,{useState,useEffect} from 'react'
import {listOfQuizes as quizes} from "./listOfQuizes"
import  Test from './Test'
import {NavLink} from 'react-router-dom';
import {Context} from './context'

const Home = ()=>{
    const [listOfQuizes,setListOfQuizes]=useState(quizes)
    const [activeQuize,setActiveQuize]= useState(0)


   const  quizeHandlerClick =(id)=>{
      setActiveQuize(id)

   }

    return(
        <>
    {activeQuize===0?
      <ul>
          {listOfQuizes.map(listOfQuize=>{
              return (
                  <li onClick={() => quizeHandlerClick(listOfQuize.id)} key={listOfQuize.id}>{listOfQuize.name}</li>

              )

        })}
        </ul>: <Test listOfQuize={listOfQuizes[activeQuize]}/>



    }</>)

}
export default Home
